import React, { Component } from "react";
import "./App.css";
import UsersTable from "./UsersTable";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: null,
    };
  }

  componentDidMount() {
    fetch("http://localhost:8801/design/users/getAllUsers", { mode: "no-cors" })
      .then((res) => res.json())
      .then(
        (result) => {
          console.log("FERMIN data = " + result);
          this.setState = { data: result.data };
        },
        (error) => {
          // do nothing
        }
      );
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>Jesus Lorca Luque</p>
          <UsersTable />
        </header>
      </div>
    );
  }
}

export default App;
